<template>
  <div id="app">
  <div class="container">
      <div class="columns">
        <div class="column">
          <img src="./assets/logo.jpg" width="150">
        </div>
      </div>
      <div class="columns">
        <div class="column">
          <h1 class="title has-text-info has-text-centered is-light">
            ระบบพิมพ์ใบเกียรติบัตรสำหรับผู้เข้าร่วมอบรมทางไกล เรื่อง เลิกบุหรี่ ดีอย่างไร
          </h1>
          <h1 class="subtitle has-text-info">สภาเทคนิคการแพทย์</h1>
        </div>
      </div>
      <div class="columns">
        <div class="column is-one-third is-offset-4">
          <b-field label="คำนำหน้า" message="คำนำหน้าจะปรากฎบนใบประกาศตามที่ท่านกำหนด">
            <b-input v-model="title"></b-input>
          </b-field>
          <b-field label="ชื่อ">
            <b-input v-model="firstname"></b-input>
          </b-field>
          <b-field label="นามสกุล">
            <b-input v-model="lastname"></b-input>
          </b-field>
          <b-field>
            <div class="buttons is-centered">
              <b-button type="is-primary" @click="generate" :disabled="isFormNotValid">
                Create
              </b-button>
            </div>
          </b-field>
        </div>
      </div>
      <div class="columns">
        <div class="column">
          <p class="notification is-warning">
          หากไม่พบรายชื่อ กรุณาติดต่อสภาเทคนิคการแพทย์ที่ไลน์ @mtcouncil2547
          </p>
        </div>
      </div>
    </div>
  </div>
</template>

<script>
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
import { db } from './firebase';
import { query, where, collection, getDocs } from 'firebase/firestore'
pdfMake.vfs = pdfFonts.pdfMake.vfs;

pdfMake.fonts = {
  Fahkwang: {
    normal: 'Fahkwang-Regular.ttf',
    bold: 'Fahkwang-Bold.ttf',
    italics: 'Fahkwang-Italic.ttf',
    bolditalics: 'Fahkwang-BoldItalic.ttf'
  }
}

export default {
  name: 'App',
  components: {
  },
  data () {
    return {
      firstname: '',
      lastname: '',
      license: '',
      title: '',
    }
  },
  computed: {
    fullname () {
      return this.title + this.firstname + " " + this.lastname
    },
    isFormNotValid () {
      return this.firstname === '' || this.lastname === ''
    }
  },
  methods: {
    async generate () {
        let ref = collection(db, 'participants')
        let q = query(ref, where('firstname', '==', this.firstname), where('lastname', '==', this.lastname))
        let querySnapshot = await getDocs(q)
        if (querySnapshot.docs.length == 0) {
          this.$buefy.toast.open({
            message: 'ไม่พบรายชื่อ กรุณาลองใหม่อีกครั้ง',
            type: 'is-danger',
          })
          return
        }
        let docDefinition = {
          content: [
            {
              columns: [
                {
                  width: '25%',
                  text: "",
                },
                {
                  image: "data:image/png;base64,",
                  width: 100,
                },
                {
                  image: "data:image/png;base64,",
                  width: 70,
                },
                {
                  image: "data:image/png;base64,",
                  width: 110,
                },
              ],
              columnGap: 50,
            },
            {
              text: 'เครือข่ายวิชาชีพเทคนิคการแพทย์เพื่อสังคมไทยปลอดภัยบุหรี่', fontSize: 32, alignment: 'center', lineHeight: 1.3, bold: true,
            },
            {
              text: 'สภาเทคนิคการแพทย์', fontSize: 32, alignment: 'center', lineHeight: 1.3, bold: true
            },
            {
              text: 'ขอมอบเกียรติบัตรฉบับนี้เพื่อแสดงว่า', fontSize: 24, alignment: 'center', lineHeight: 1.6, bold: false
            },
            {
              text: this.fullname, fontSize: 26, alignment: 'center', lineHeight: 1.3, bold: true
            },
            {
              text: 'ได้เข้าร่วมโครงการอบรมทางไกล ครั้งที่ 4', alignment: 'center', fontSize: 22, lineHeight: 1.2
            },
            {
              text: 'เรื่อง เลิกบุหรี่.......แล้วดีอย่างไร', alignment: 'center', fontSize: 22, lineHeight: 1.6, bold: true
            },
            {
              text: 'วันที่ 29 มกราคม 2565', alignment: 'center', lineHeight: 1.3, fontSize: 21
            },
            {
              alignment: 'center',
              image: 'data:image/jpeg;base64,',
              width: 70
            },
            {
              text: '(นายสมชัย เจิดเสริมอนันต์)', alignment: 'center', fontSize: 18
            },
            {
              text: 'นายกสภาเทคนิคการแพทย์', alignment: 'center', fontSize: 18
            }
          ],
              defaultStyle: {
            font: 'Fahkwang'
          },
          pageSize: "A4",
          pageOrientation: "landscape",
          pageMargins: [30, 20, 30, 30],
        }
      pdfMake.createPdf(docDefinition).open()
    }
  }
}
</script>

